  return (

    <NavigationContainer>
      <Stack.Navigator initialRouteName='LandingScreen'>
        <Stack.Screen name='LandingScreen' component={LandingScreen} options = {{headerShown: false}} />
        <Stack.Screen name="RegisterScreen" component={RegisterScreen} />

      </Stack.Navigator>


    </NavigationContainer>

  );
}








